import React from 'react';

export default function Projects() {
  return (
    <section id="projects" data-aos="fade-up">
      <h2>Projects</h2>
      <p><strong>HavenHub (Airbnb Clone)</strong>: A rental platform using HTML, CSS, JS, Node.js, MongoDB, Bootstrap, and Mapbox.</p>
    </section>
  );
}
